window.bookSummaryJSON = "<p>Lucas \"Luke\" Patterson, an ordinary geeky college student, gets a summer job at Vortex Industries. His summer job is to test a new virtual reality game using the Vortex Capsule, a machine capable of fully immersing you into virtual reality. </p> <p>His first session is life-changing, and he quickly becomes engrossed in a new fantasy world. Things are going great until a rogue hacking group attacks the servers that host the game, trapping all the players inside. Things get even worse when a dark force gains power and have sinister plans for Endless Fantasy Online. </p> <p>Can Luke and his new friends survive the dark forces that are on the rise? Will he, and the other players, be able to cope with the fact that they can't return to Earth? Will Vortex Industries find the hacking group responsible and save the players? </p> <p>Find answers to all of this and more in <i>Endless Fantasy Online: The Phoenix Kingdom</i>!</p>"; 
